import { connect } from "react-redux";
import React, { Component } from 'react';


const City = (props) => {

    const {city} = props;

    return (
        <div>
            <h3>{city.name}</h3>
            <h3>{city.temp}</h3>
        </div>
    );
};


class CityList extends Component {


    render() {

        const {dataCity} = this.props.dataCity;

        console.log(this.props);

        const cityList = dataCity.map((city) => <City dataCity = {city} />

        );

        return (
            <div>{cityList}</div>
        );

    }

}

const mapStateToProps = (state) => ({
    dataCity: state.city
});

export default connect(mapStateToProps)(CityList);
